import React from 'react'
import { Navbar, Nav, NavItem } from 'react-bootstrap';
import { Link } from "react-router-dom";
import './Navbar.css';


const NavBar = (props) => {
  return (
    <Navbar>
        <Navbar.Header>
        <Navbar.Brand>
            <a href="/">nancy yao</a>
        </Navbar.Brand>
        </Navbar.Header>
        <Nav pullRight>
          <NavItem>
          </NavItem>
        </Nav>
    </Navbar>
  )
}

export default NavBar
